Rachel Rising #19-22
Publisher:  Abstract Studio
Publication Date:  September 11, 2013 - December 31, 2013

Written and Art by Terry Moore

Rachel Rising #19
Terry Moore's horror thriller looks back 300 years to the day the little town of Manson murdered 300 women for witchcraft.

Rachel Rising #20
Rachel has to improvise to save Aunt Johnny's spirit, while Zoe and the priest have a cutting edge discussion about the anti-Christ.

Rachel Rising #21
Rachel enlists Dr. Siemen to bring Aunt Johnny back from the dead while Zoe seeks shelter from the storm in a gas station.

Rachel Rising #22
Dr Siemen tries a highly unorthodox method to revive Aunt Johnny. Meanwhile Rachel ventures out into the storm to retrieve something very precious to her and learns a shocking truth from her past.

